const Category = () => {
  const name = ["개발", "개발2", "개발3", "게발게발", "개발ㄹㄹㄹ"];
  const nameList = names.map((name) => (
    <li class="Explore_CategoryItem__46TK9" id="gaebal">
      <Link to="/gaebal">
        <em>개발</em>
      </Link>
    </li>
  ));

  return <div></div>;
};

export default Category;
